import React from "react";



const Contact = () => {


  return (
    <React.Fragment>
      <div className="container page-content">
        {/* <div className="row">
        <div className="col-12"> */}
        <form name="contact" method="post">
          <input type="hidden" name="form-name" value="contact" />
          <div className="form-group row">
            <label className="col-8">Your Name: <input type="text" className="form-control" name="name"/></label>
            </div>
         <div className="form-group">
            <label>Your Email: <input type="email" name="email" className="form-control"/></label>
        </div>
         <div className="form-group">
            <label>Message: <textarea name="message" className="form-control"></textarea></label>
        </div>
            <button type="submit" className="btn btn-primary">Send</button>
        </form>
        {/* </div>
        </div> */}

      </div>
    </React.Fragment>


  );
};

export default Contact;
